import torchvisionfrom torchvision.models.detection.faster_rcnn import FastRCNNPredictorfrom torchvision.models.detection import FasterRCNN_ResNet50_FPN_Weightsdef create_model(num_classes):    model = torchvision.models.detection.fasterrcnn_resnet50_fpn(weights=FasterRCNN_ResNet50_FPN_Weights.DEFAULT)    #model = torchvision.models.detection.fasterrcnn_resnet50_fpn(pretrained = True)    in_features = model.roi_heads.box_predictor.cls_score.in_features    #defining a new head for the detector with required number of classes    model.roi_heads.box_predictor = FastRCNNPredictor(in_features, num_classes)    return model